import React from 'react';
import './components/styles/App.css';
import Navbar from './components/Navbar';
import Backgroundvideo from './components/Backgroundvideo';
import CreateRoom from './components/CreateRoom';


function App() {
  return (
    <div className="App">
      <header>
        <nav><Navbar/>
        </nav></header>
        <body>
        <CreateRoom/>
        <Backgroundvideo/>
        </body>
    </div>
  );
}

export default App;
